import React, { Component } from 'react'
import './login.css'

export default class Login extends Component {
    render() {
        return (
            <div className="login">
                <header className="login-header">
                    <img src="" alt="" />
                    <h1>矢易后台管理系统</h1>
                </header>
                <section className="login-content"></section>
            </div>
        )
    }
}
